class DeviceCard extends StatelessWidget {
  final String name;
  final String image;
  final int price;
  final int discountedPrice;
  final int discount;

  const DeviceCard({super.key, required this.name, required this.image, required this.price, required this.discountedPrice, required this.discount});

  @override
  Widget build(BuildContext context) {
    return Container(
      decoration: BoxDecoration(
        color: Colors.white,
        borderRadius: BorderRadius.circular(8),
        boxShadow: [BoxShadow(color: Colors.black12, blurRadius: 4)],
      ),
      child: Column(
        children: [
          Expanded(child: Image.network(image, fit: BoxFit.cover, width: double.infinity)),
          Padding(
            padding: const EdgeInsets.all(6),
            child: Column(
              children: [
                Text(name, textAlign: TextAlign.center, style: const TextStyle(fontSize: 10, fontWeight: FontWeight.bold)),
                const SizedBox(height: 2),
                Text("LKR $discountedPrice", style: const TextStyle(fontSize: 10, color: Colors.green, fontWeight: FontWeight.bold)),
                if (discount > 0)
                  Text("Original: LKR $price (-$discount%)", style: const TextStyle(fontSize: 8, color: Colors.red, decoration: TextDecoration.lineThrough)),
              ],
            ),
          ),
        ],
      ),
    );
  }
}

